electronics :- 

	nl, write("======================="), nl,
	nl,write("Welcome to Electronics section"),nl,
	nl,write("========================"),nl,
	
	nl,write("What category do you most relate with? (Type index) \n1. Student\n2. Employee\n3. Business\n"),
	read(Occupation),nl,

	%============================================ main item types
	nl, write("Select the product which you want to buy from the given list:"),nl,
	items(electronics_categories, X),
	present(X),nl,
	read(Item_type_Main),nl,

	%========================a particular category product list
	nl, write("Select the type of product you would like to buy:"), nl,
	items(Item_type_Main,Y),
	present(Y),
	read(Item_subtype),nl,
	items(Item_subtype, Result_subtype),
	%present(Result_subtype), nl,
	%======================================Best rated product for you
	write("Here is the top rated product according to your needs:"), nl, 
	ith_val(Result_subtype, 1, Best_product),
	print_features(Best_product), nl,nl,
	
	%======================================Stats to set budget
	write("=============================================================="),nl,
	write("Here are some stats to help aid your searching experience- :"),nl,nl,
	sum_of_prices(Result_subtype, 0,Sum),
	write("Average Product Price: "),
	size(Result_subtype, 0, Total_products),
	Avg is Sum/Total_products,
	write(Avg),nl,nl,
	
	write("The price range available here is: "),nl,
	
	lowest_price(Result_subtype, 1000000,LP),
	write("	The lowest price is: "),
	write(LP),nl,
	
	highest_price(Result_subtype, 0,HP),
	write("	The highest price is: "),
	write(HP),nl,nl,
	
	total_reviewers(Result_subtype, 0,Tot),
	write("The total numbers of reviewers that rated this product subtype: "),
	write(Tot),nl,nl,
	write("=============================================================="),nl,

	%======================================BUDGET
	
	write("Since you are a "),
		
	(Occupation=:=1->write("Student"),
	write(" ,your auto-budget is set too: "),nl,
	write("0 - "),
	write(Avg),nl,
	write("\nDo you wish to change this?(Choose Index) \n1.Yes \n2.No\n"),
	read(Choice),nl,
	(Choice=:=2->write("These are the recommendations based on your budget (Top Rated First):\n"),nl,budget_options(0, Avg, Result_subtype,Flag)
		;write("Please provide your budget(lower limit):"),nl,
		read(Lower_limit),
		write("Please provide your budget(Upper limit):"),nl,
		read(Upper_limit),nl,
		write("These are the recommendations based on your budget (Top Rated First):\n"),nl,
		budget_options(Lower_limit, Upper_limit, Result_subtype,Flag),
		(Flag==1->write("");write(""), 
			
			(Upper_limit<Avg->budget_options(0, Avg, Result_subtype,Flag),nl;
			budget_options(Avg, HP, Result_subtype,Flag))
			
		
		),
		
		
		write(""))
	;write("")),
	
	(Occupation=:=2->write("Employee"),
	write(" ,your auto-budget is set too: "),nl,
	write(Avg),
	write(" - "),
	write(HP),nl,
	write("\nDo you wish to change this?(Choose Index) \n1.Yes \n2.No\n"),
	read(Choice),nl,
	(Choice=:=2->write("These are the recommendations based on your budget (Top Rated First):\n"),nl,budget_options(0, Avg, Result_subtype,Flag)
		;write("Please provide your budget(lower limit):"),nl,
		read(Lower_limit),
		write("Please provide your budget(Upper limit):"),nl,
		read(Upper_limit),nl,
		write("These are the recommendations based on your budget (Top Rated First):\n"),nl,
		budget_options(Lower_limit, Upper_limit, Result_subtype,Flag),
		(Flag==1->write("");write(""), 
			
			(Upper_limit<Avg->budget_options(0, Avg, Result_subtype,Flag),nl;
			budget_options(Avg, HP, Result_subtype,Flag))
			
		
		),
		
		
		write(""))	
	;write("")),
	
	(Occupation=:=3->write("Business"),
	write(" ,your auto-budget is set too: "),nl,
	write("0 - "),
	write(HP),nl,
	write("\nDo you wish to change this?(Choose Index) \n1.Yes \n2.No\n"),
	read(Choice),nl,
	(Choice=:=2->write("These are the recommendations based on your budget (Top Rated First):\n"),nl,budget_options(0, Avg, Result_subtype,Flag)
		;write("Please provide your budget(lower limit):"),nl,
		read(Lower_limit),
		write("Please provide your budget(Upper limit):"),nl,
		read(Upper_limit),nl,
		write("These are the recommendations based on your budget (Top Rated First):\n"),nl,
		budget_options(Lower_limit, Upper_limit, Result_subtype,Flag),
		(Flag==1->write("");write(""), 
			
			(Upper_limit<Avg->budget_options(0, Avg, Result_subtype,Flag),nl;
			budget_options(Avg, HP, Result_subtype,Flag))
			
		
		),
		
		
		write(""))
	;write("")),
	
	
	%write("Add more filters to help get better recommendations. "),nl,nl,
	%write("Please provide your budget(lower limit):"),nl,
	%read(Lower_limit),
	%write("Please provide your budget(Upper limit):"),nl,
	%read(Upper_limit),
	%budget_options(Lower_limit, Upper_limit, Result_subtype),

	%====================================== Show the brands
	write("Would you like to get recommendations based on brands?(ChooseIndex)\n1.Yes\n2.No"),nl,nl,
	read(Brand_choice),
	(Brand_choice=:=1->
		write("Pick a brand from the brands available(Please write the name within double inverted comas):"),nl,
		get_ith_list(Result_subtype, 1, Brand_list),
		present_till_last(Brand_list),nl,
		
		%DEBUGGGGGGGGGGGGG
		read(Brand_Name),
		brand_based(Brand_Name,Result_subtype)
		
		;write("")
	),

	%=========================================Would you like to search for more products
	write("Would you like to search for more products?(1,0)"),nl,
	read(More_products),
	(More_products =:= 1 -> electronics ; nl,write("THANKYOU FOR USING JCT RECOMMENDATION SYSTEM"), nl)

	%======================================


