%========================================================================
%							Helper functions
%========================================================================

%====================
% To print the data
%====================
present([]).
present([H | T]) :-  write(H),nl, present(T).


%====================
% if a person already owns a product from this category ??
%====================
owns :-
	write("Give the brand of your owned item:"), nl,
	read(Own_brand)
	.

%====================
%Get list of all the ith values
% to get ith_list(Brand -> 1, Name -> 2, Price -> 3, Rating -> 4, No of reviews -> 5)
%====================
get_ith_list([], _, X).
get_ith_list([H | T], N, L):- 
	ith_val(H, N, Val),
	(memberchk(Val, L) -> get_ith_list(T, N, L) ; get_ith_list(T, N, [Val | L]))
.


%====================
% get ith value from the list
%====================
ith_val([X], 1, X).
ith_val([H|_], 1, H).
ith_val([_|T], I, E) :- Index is I-1, ith_val(T, Index, E).

%====================
%print all vals till second last values
%====================
present_till_last([]).
present_till_last([H | T]) :-  
	((not(H == T)) -> write(H),nl),
	present(T).

%====================
%CALCULATE LIST SIZE
%====================
size( [], L , L ) .
size( [_|Xs] , T , L ) :-
  T1 is T+1 ,
  size(Xs,T1,L)
.

%===================
%BEST RATED PRODUCT
%===================
best_rated([X],X) :- !, true.
best_rated([X|Xs], M):- 
	ith_val(X, 4, V1),
	ith_val(M, 4, V2),
	best_rated(Xs, M), V2 >= V1.
best_rated([X|Xs], X):- 
	ith_val(X, 4, V1),
	ith_val(M, 4, V2),
	best_rated(Xs, M), V1 > V2.

%==================
%Budget budget options
%==================
budget_options(L,U, [],_).
budget_options(L, U, [H | T],F):-
	ith_val(H, 3, Price),
	(Price >= L, Price =< U -> FF is 1, print_features(H), nl ; write("")),
	budget_options(L,U,T,FF)
.

%==================
%Present features
%==================
print_features(A) :-
	format('Brand : ~w\n Name and descripton : ~w\n Price(in rupees) : ~w\n Rating(Out of 5) : ~w\n Total Ratings : ~w~n', A).

%===========================================================

% to add unique elements in list.
%add_unique([], _).
%add_unique([H |T], L) :- (member(H, L) -> add_unique(T, L) ; add_unique(T, [H | L])).







%===========================================================
sum_of_prices( []     , L , L ).
sum_of_prices( [H|T] , T2 , L ) :-
  ith_val(H,3,P),
  T1 is T2+P,
  sum_of_prices(T,T1,L)
.

%===========================================================
lowest_price([],L,L).
lowest_price([H|T],T2,L):-
  ith_val(H,3,P),
  (P<T2->T1 is P;T1 is T2),
  lowest_price(T,T1,L)
.

highest_price([],L,L).
highest_price([H|T],T2,L):-
  ith_val(H,3,P),
  (P>T2->T1 is P;T1 is T2),
  highest_price(T,T1,L)
.

%==========================================================

total_reviewers( []     , L , L ).
total_reviewers( [H|T] , T2 , L ) :-
  ith_val(H,5,P),
  T1 is T2+P,
  total_reviewers(T,T1,L)
.

%==========================================================
brand_based(L,[]).
brand_based(L,[H|T]):-
	ith_val(H,1,P),
	(P=@=L->print_features(H),brand_based(L,T);brand_based(L,T)).




